import "./App.css";
{
    const popUpForm = document.getElementById("popUpForm");
var button = document.getElementById("addBook");
//Form Pop-Up//
//button.onclick = () => {window.open('hello!')};//

//button function//
button.addEventListener("click", function() {
  document.getElementById("popUpForm").style.display = "block";

});
}

function Uploadvideo() {
     return (

    <div class="uploadVideo">
      <button
        data-toggle="collapse"
        data-target="#demo"
        class="uploadVideo_btn"
      >
        <a href="#0">Upload Video</a>
      </button>
      <form>
        <div>
          <label>Title</label>
          <input type="text" class="input" name="title" required></input>
        </div>
        <div>
          <label>url</label>
          <input type="text" class="input" name="title" required></input>
        </div>
        <div>
          <button class="cancelBtn">Cancel</button>
          <button class="uploadBtn">Upload</button>
        </div>
      </form>
    </div>
  );
}
function Searchvideo() {
  return (
    <div>
      <label>Search:</label>
      <input type="text" class="searchVideo" name="search"></input>
    </div>
  );
}

export default function Search() {
  return (
    <div class="search">
      <Uploadvideo />
      <Searchvideo />
    </div>
  );
}
